import React, {Component} from 'react';
import {Avatar, Table, TableHead, TableCell, TableRow, Typography, Paper, TableBody} from '@material-ui/core';

class Widget11 extends Component {
    render()
    {
        const {widget} = this.props;

        return (
            <Paper className="w-full rounded-8 shadow-none border-1">
                <div className="flex items-center justify-between px-16 h-64 border-b-1">
                    <Typography className="text-16">{widget.title}</Typography>
                    <Typography className="text-11 font-500 rounded-4 text-white bg-blue px-8 py-4">{widget.table.rows.length + " Members"}</Typography>
                </div>
                <div className="table-responsive">
                    <Table className="w-full min-w-full" padding="dense">
                        <TableHead>
                            <TableRow>
                                {widget.table.columns.map(column => {
                                    switch ( column.id )
                                    {
                                        case 'avatar':
                                        {
                                            return (
                                                <TableCell
                                                    key={column.id}
                                                    className="whitespace-no-wrap p-8 pl-16"
                                                >
                                                    {column.title}
                                                </TableCell>
                                            )
                                        }
                                        default:
                                        {
                                            return (
                                                <TableCell
                                                    key={column.id}
                                                    className="whitespace-no-wrap"
                                                >
                                                    {column.title}
                                                </TableCell>
                                            )
                                        }
                                    }
                                })}
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {widget.table.rows.map(row => (
                                <TableRow key={row.id}>
                                    {row.cells.map(cell => {
                                            switch ( cell.id )
                                            {
                                                case 'avatar':
                                                {
                                                    return (
                                                        <TableCell
                                                            key={cell.id}
                                                            component="th"
                                                            scope="row"
                                                            className="pl-16 pr-0"
                                                        >
                                                            <Avatar src={cell.value}/>
                                                        </TableCell>
                                                    )
                                                }
                                                case 'name':
                                                {
                                                    return (
                                                        <TableCell
                                                            key={cell.id}
                                                            component="th"
                                                            scope="row"
                                                            className="truncate font-600"
                                                        >
                                                            {cell.value}
                                                        </TableCell>
                                                    )
                                                }
                                                default:
                                                {
                                                    return (
                                                        <TableCell
                                                            key={cell.id}
                                                            component="th"
                                                            scope="row"
                                                            className="truncate"
                                                        >
                                                            {cell.value}
                                                        </TableCell>
                                                    )
                                                }
                                            }
                                        }
                                    )}
                                </TableRow>
                            ))}
                        </TableBody>
                    </Table>
                </div>
            </Paper>
        );
    }
}

export default Widget11;
